New build AR-15.  Price reduced to $950.

Code Red multi-caliber lower receiver; 
SOTA Arms flat top upper receiver with M4 feed ramps; 
DSArms 5.56x45 NATO 1x9 16" barrel with M4 feed ramps; 
Standard A-2 bird cage flash hider; 
Railed gas block; 
Red dot sight; 
MilSpec M-16 bolt carrier group; 
All MilSpec internals; 
Blackhawk adjustable stock with sling quick disconnect; 
Blackhawk pistol grip; 
Round handguard.

One 30-round magazine.

Spring kit with disconnector your 1911 Government model! 
The most commonly worn and broken springs/parts are here;
Main
Sear
                                                   Plunger (with proper offset in middle)
       Firing pin
                       and a disconnector
These parts are brand new, never installed.

 Plus.... you get Hallock's 178 page book on how to tune/rebuild/modify your .45 Auto. This 1980 book by Ken Hallock is a definitive work on the 1911. The book is "Out of Print--Limited Availability" and often sells for over $35 on Amazon.
                                       Chapters include: 
Operating the pistol; 
Assembly and disassembly;
How the .45 functions; 
Inspection for defects; 
History; Identification; 
Miscellaneous information and modifications; 
The tune up; 
The trigger job; 
The accuracy job;
and Match and adjustable sights.
